import "./App.css";
import React from "react";
import Login from "./Login";
import Dashboard from "./Dashboard";
import { Switch, Route } from "react-router-dom";

function App() {
  <>
    <Switch>
      <Route path="/" component={Login}></Route>
      <Route path="dashboard" component={Dashboard} />
    </Switch>
  </>
}

export default App;
